export async function loadAllSSCCGLPapers() {
  const service = SSCCGLService.getInstance();
  let loaded = 0;
  let failed = 0;
  
  console.log(' Loading ' + PAPER_FILES.length + ' SSC CGL papers...');
  
  for (const paper of PAPER_FILES) {
    try {
      const paperModule = await import('../../SSC_CGL/' + paper.fileName);
      const paperData = paperModule.default || paperModule;
      
      let answersData = null;
      if (paper.hasAnswers) {
        try {
          const answersModule = await import('../../ai_generated_answers/' + paper.fileName);
          answersData = answersModule.default || answersModule;
        } catch (e) {
          console.warn('No answers for ' + paper.displayName);
        }
      }
      
      await service.loadPaper(paper.id, paperData, answersData);
      loaded++;
      
      if (loaded % 25 === 0) {
        console.log(' ' + loaded + '/' + PAPER_FILES.length + ' papers loaded');
      }
    } catch (error) {
      failed++;
      console.error('Failed to load ' + paper.displayName);
    }
  }
  
  console.log(' Complete! Loaded: ' + loaded + ', Failed: ' + failed);
  return { loaded, failed, total: PAPER_FILES.length };
}

export async function loadPapersByYear(year: number) {
  const service = SSCCGLService.getInstance();
  const yearPapers = PAPER_FILES.filter(p => p.displayName.includes('' + year));
  let loaded = 0;
  
  for (const paper of yearPapers) {
    try {
      const paperModule = await import('../../SSC_CGL/' + paper.fileName);
      const paperData = paperModule.default || paperModule;
      
      let answersData = null;
      if (paper.hasAnswers) {
        try {
          const answersModule = await import('../../ai_generated_answers/' + paper.fileName);
          answersData = answersModule.default || answersModule;
        } catch {}
      }
      
      await service.loadPaper(paper.id, paperData, answersData);
      loaded++;
    } catch (error) {
      console.error('Failed: ' + paper.displayName);
    }
  }
  
  console.log(' Loaded ' + loaded + ' papers from year ' + year);
  return loaded;
}

